import React from 'react'
import styled from "styled-components"
import BlankPhone from "../images/sideways-phone-blank.svg"

const Container = styled.div`
    width: 100%;
    height: 120px;
    background-color: #fff;
    font-family: 'Lato', sans-serif;
    color: #111439;
    padding-top: 20px;
    margin-top: 60px;
    background-color: #F6F9FC;
`

const ContentContainer = styled.div`
    width: 1100px;
    height: 100px;
    margin-left: 50%;
    transform: translateX(-50%);
    display: flex;
    background: #0f0;
`

const TextContainer = styled.div`
    width: 100%;
    text-align: center;
    background: #f00;
`

const CopyrightText = styled.h1`
    margin-top: px;
    font-weight: 300;
    font-size: 1rem;
    color: #494B6488;
`

const MadeWithText = styled.h1`
    margin-top: 8px;
    font-weight: 300;
    font-size: 1rem;
    color: #494B64ff;
`

const DotLine2 = styled.div`
    position: absolute;
    right: 0;
    width: 1px;
    background-image: linear-gradient(#EBEBEB 50%, rgba(255,255,255,0) 0%);
    background-position: right;
    background-size: 1px 12px;
    background-repeat: repeat-y;
    height: 120px;
`


// const TrademarkText = styled.h1``

// const MadeWithText = styled.h1``

export default function ProjectSection () {
    return (
        <Container>
            <ContentContainer>
                <DotLine2 />
                <TextContainer>
                    <CopyrightText>© Copyright 2021 Ben DiMarco</CopyrightText>
                    <MadeWithText>Made with️ React and  ❤️</MadeWithText>
                </TextContainer>
            </ContentContainer>
        </Container>
    )
}
